import './File.css'
import { Link } from 'react-router-dom'
import axios from 'axios'

export const File = ({ data, onClick }) => {
	return (
		<div className='File' onClick={onClick}>
			{ data.filename }
		</div>
	)
}

export const Dir = ({ data }) => {
	return (
		<div className='Dir'>
			<Link to={`/Files${data.path}`}>{data.filename}</Link>
		</div>
	)
}

export const Preview = async({ file }) => {

	let data

	const getPreview = (file) => {
		axios.get(`http://192.168.1.37:8080/files${file}`).then(file => data = file)
	}

	switch (file.ext){
		case `.png`: return (<img src={`data:image/jpeg;base64,${data}`} alt={``}/>)
		default: return (<>{file.data}</>)
	}
}
